import logo from './logo.svg';
import './App.css';
import githubSVG from "./qr-code.svg";

function App() {
  return (
    <div className="big-container">
      <div className="toparea">
        <img className="image" src={githubSVG}/>
        <p className="textbelowqr">Scan for my github link</p>

        <h2 className="center">Swojas Bhalunkar</h2>

      </div>


    <div className="container">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
    </div>
  );
}

export default App;
